__NUXT_JSONP__("/gallery/sally", (function(a,b){return {data:[{document:{date:a,title:[{type:"heading3",text:"Sally",spans:[]}],photo:{dimensions:{width:800,height:1031},alt:a,copyright:a,url:"https:\u002F\u002Fimages.prismic.io\u002Ffunk\u002Fed0cd63c-75fa-44fc-9ef7-fadf8bd5ae8b_Sally.jpg?auto=compress,format",small:{dimensions:{width:320,height:412},alt:a,copyright:a,url:"https:\u002F\u002Fimages.prismic.io\u002Ffunk\u002Fed0cd63c-75fa-44fc-9ef7-fadf8bd5ae8b_Sally.jpg?auto=compress,format&rect=0,0,800,1030&w=320&h=412"}},content:[{type:b,text:"I Was actually doing shots of a friend’s Chihuahuas (did I spell  that right?), and this black cocker from next door just sauntered in,  curled up and posed and said “You fool… WHY are you wasting time on  those idiots… take me now while I’m in the mood”. So I did. The  Chihuahuas hated me and the cocker, whos name it turns out was Sally. ",spans:[]},{type:b,text:"Don't know what ultimately became of her. But she is now immortal. And has an Oscar from me.",spans:[]},{type:b,text:"Canon EOS 100 + EF 100 mm f2,8 fixed focal, on Fuji Reala 100 ISO print film.",spans:[]},{type:b,text:"Negative scanned on a Canon FS 2710 film scanner, converted to B\u002FW in Photoshop 6.0.",spans:[]}],page:"Page 2",tag:"pets"}}],fetch:[],mutations:void 0}}(null,"paragraph")));